import { useEffect } from "react";
import axios from "axios";
import { useState } from "react";
import React from "react";

export const ContactList = () => {
  const [isLoading, setIsLoading] = useState(false);
  const [jsonData, setJsonData] = useState("");

  useEffect(() => {
    async function getData() {
      setIsLoading(true);

      try {
        // axios.get("http://localhost:3001/getAllContact").then((res) => {
        //   console.log(res);
        //   setJsonData(res);
        // });
        const res = await axios.get("http://localhost:3001/getAllContact");
        console.log(res);
        setJsonData(res);
      } catch (e) {
        console.log(e);
      }
      setIsLoading(false);
    }
    getData();
  }, []);
  return <>test</>;
};
